import { FETCH_WEATHER } from 'redux/actions/types';

const initialState = {
  weather: [],
  loading: false,
  error: null,
};

export default function data(state = initialState, action) {
  switch (action.type) {
    case FETCH_WEATHER:
      return action.payload;
    default:
      return state;
  }
}
